    return(
        <div>
            <Hero title={props.title} />

             <Content>
                    <div>
                    <div></div>
                    <div></div>
                    </div>
            <p>Hello, my name is Pranamya. I'm a Masters in Computer Science student at Indiana University Bloomington</p>
             </Content>

             <View
                style={{
                flexDirection: "row",
                height: 100,
                padding: 20
                }}
            >
                <View style={{ backgroundColor: "blue", flex: 0.3 }} />
            </View>

        </div>
    );

}

export default ExperiencePage;
